import React from 'react'
import { Routes, Route } from 'react-router-dom'
import About from './components/pages/About'
import Login from './components/user/Login/Login'

const App = () => {
  return (
    <Routes>
      <Route path="/" element={<Login />} />
    </Routes>
  )
}

export default App
